import React from "react";
import { Link } from "react-router-dom";
import "./style.css";

function Skills(props) {
	return (
        <div class="box">
          <i class={props.icon}></i>
          <img src={props.img}/>
          <br /><p>{props.skill}</p>
        </div>
	)
};

export default Skills;
